script: |
  super -f text -I q4298.spq | sort > q4298.out

inputs:
  - name: q4298.spq
    data: |
      SELECT ALL 78 + - col1 AS col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE 20 NOT BETWEEN - - ( - - 49 ) * - col2 + 70 AND - col2 * + col1 + col0;
  - name: tab1

outputs:
  - name: q4298.out
    data: |
      31
      64
      73
